import Header from "../Header/Header";
import Logotype from "../Logotype/Logotype";
import Experience from "../Experience/Experience";
import Services from "../Services/Services";

function HomePage(props) {
  return (
    <>
      <section className="advertising">
        <Header
          text={props.text.header}
          languages={props.languages}
          curLang={props.currLang}
          setLanguage={props.setLanguage}
          links={props.links}
        ></Header>
        <Logotype title={props.text.logotype.title} />
        <Experience
          list={props.text.experience.list}
          definition={props.text.experience.definition}
        />
        <Services
          upper={props.text.service.upper}
          title={props.text.service.title}
          list={props.text.service.list}
          images={props.serviceImages}
        />
      </section>
    </>
  );
}

export default HomePage;
